import React from 'react';
import './InsertNumber.css';


function InsertNumber() {
    return (
        <div>
            <body className="App-insert">
                <p style={{ fontSize: 40, textAlign: "center" }}>Insert ur number</p>
                <form>
                    <p>
                        <input
                            type="text"
                            placeholder="example :1,2,3,4,5"
                        />
                    </p>
                </form>
            </body>


        </div>
    );
}

export default InsertNumber;
